import "./style.css"; 

export default function Main(){
    return (
        <div className="content1">
        <div className="image-container"></div>
        <ul>
            <li>
                <h4>Welcome to my world </h4>
            </li>
        </ul>
        <h1>Hi I'M VIGNESH KS <br/><span>REACT DEVELOPER <br/></span></h1>
        <h2>based in INDIA</h2>
        </div>
        
    )
}
